import zipfile
import io
import requests

from django.core.management.base import BaseCommand, CommandError

class Command(BaseCommand):
    help = 'Download traffic data'

    def handle(self, *args, **options):
            for x in range(1, 12):
                print(str(x) + " document downloading....")
                data = {
                    "configuracionInfPersonalizado" : "configuracionInfPersonalizado",
                    "configuracionInfPersonalizado:filtroMesAnyo" : 2022,
                    "configuracionInfPersonalizado:filtroMesMes" : x,
                    "configuracionInfPersonalizado:j_id131": "Descargar",
                    "javax.faces.ViewState" : ""
                }
                page = requests.post("https://sedeapl.dgt.gob.es/WEB_IEST_CONSULTA/subcategoria.faces", data, stream=True)

                print(page.content)

                z = zipfile.ZipFile(io.BytesIO(page.content))
                z.extractall("./dumps_autoescuela")
                print(z.filelist[0].filename)
